import React from "react";
import logo from "../images/react_icon.png";
import "../style.css";
export default function Navbar(){
    return(
        <div className="">
            <nav className = "nav">
            <img src = {logo} alt = "Logo" width="80px"/>
            <h3>ReactFacts</h3>
            <h4>React Course - Project 1</h4>
        </nav>
        </div>
    )
}
